window.bookSummaryJSON = "<p><i>Conquest</i> is the next chapter in the great interstellar war between all living creatures and the machines. Star Force must stop the machine invaders once again - but how? </p> <p>In the fourth book of the Star Force series, Kyle Riggs has freed Earth from the chains of the Macros - but at what cost? The Macros no longer trust him. He is a mad dog that must be put down - and all Star Force must be stamped out with him. The war expands in this story, and mankind is once again faced with annihilation.</p>"; 
